    false,nt"url": null,nt"notes": "This report details the Vegetation Mapping
    Project at the Massasoit National Wildlife Refuge (NWR) inPlymouth, Massachusetts
    (Figure 1) which is part of the Eastern Massachusetts NWR Complex owned and managed
    by the U.S. Fish and Wildlife Service (USFWS). The mapping project has been initiated
    by the USFWS in response to the need for background data to meet resource management
    needs and deal with existing and potential resource issues at Massasoit NWR. The
    project involves production of new aerial photographic imagery, interpretation of
    imagery and field data to determine the vegetation cover types existing at the NWR,
    and production of vegetation community cover type maps based upon those determinations.
    The vegetation cover types are based upon the National Vegetation Classification
    System (NVCS) developed by U.S. Geological Survey (USGS) and the National Park Service
    (NPS). The purpose of this mapping project is to create a product which will allow
    the USFWS to better address conserving, protecting and enhancing fish, wildlife,
    plants, and their habitats present at the Massasoit NWR. The NVCS data and inventory
    methodology used provides the USFWS land managers with comparable units upon which
    to focus management practices based on the characteristics and management concerns
    specific to the Massasoit NWR.",nt"license_title": "License Not Specified",nt"extras":
